const body = document.getElementById("body");
const text = document.createElement("div");
const map = document.createElementNS("http://www.w3.org/2000/svg", "svg");
const interface = document.createElement("div");

const borderMinX = 0;
const borderMaxX = 150;
const borderMinY = 0;
const borderMaxY = 400;

var activeRegion = 0;
var mapWidth = 0;
var mapHeight = 0;

var x = 0;
var y = 0;
var zx = 500;
var zy = 500;

var positionInfo = map.getBoundingClientRect();
var height = positionInfo.height;
var width = positionInfo.width;

let mx1 = 0;
let mx2 = 0;
let my1 = 0;
let my2 = 0;
let dx = 0;
let dy = 0;

let mouseDown = false;

let floor = 0;



function constructor() {
    body.appendChild(map);
    body.appendChild(text);
    body.appendChild(interface);

    updateView();
    drawRegions(regions[floor], backgrounds[floor], elevators[floor]);
    addEventListeners();
    loadInterface();
    loadStyles();

    mapWidth = map.clientWidth;
    mapHeight = map.clientHeight;
}

function drawRegions(region, background, elevator) {
    // draw background
    background.forEach((x, i) => {
        map.innerHTML += '<path id="back_' + i + '" d= "' + x.coordinates + '" fill="rgba(126,126,126,0.5)"> </path>'
    })

    region.forEach((x, i) => {
        map.innerHTML += '<path id="region_' + i + '" d= "' + x.coordinates + '" fill="rgba(0,126,126,0.5)" stroke="white"> </path>'
    })

    elevator.forEach((x, i) => {
        map.innerHTML += '<path id="elev_' + i + '" d= "' + x.coordinates + '" fill="rgba(126,126,0,0.5)" stroke="white"> </path>'
    })
}

function loadInterface() {
    interface.innerHTML = '<button id="p2">p2</button> <button id="p1">p1</button> <button id="p0">p0</button>'
}


function addEventListeners() {

    //regios should have property ID so pro could get
    for (let i = 0; i < regions[floor].length; i++) {
        // set colorssss for active region and stuff
        let x = document.getElementById("region_" + String(i))
        x.style.fill = "grey";


        x.addEventListener('click', () => {
            activateRegion(i, regions[floor])
        })
        x.addEventListener('touchend', () => {
            //maybe it should be a different function lol
            activeRegion = i
            clearRegions();
            text.innerHTML = "regions.name"
        })

        x.addEventListener('mouseover', () => {
            x.style.fill = "green";
            map.style.cursor = "pointer"
        })

        x.addEventListener('mouseleave', () => {
            if (activeRegion != i) {
                x.style.fill = "grey";
                map.style.cursor = "default"
            }
        })
    }

    elevators[floor].forEach((y, i) => {
        let x = document.getElementById("elev_" + String(i))

        x.addEventListener('click', () => {
            floor = y.to
            reload()
            constructor()
        })

        x.addEventListener('touchend', () => {
            floor = y.to
            reload()
            constructor()
        })
    })

    map.addEventListener('wheel', (event) => zoom(event))
    map.addEventListener('mousemove', (event) => moveAround(event))
    map.addEventListener('mousedown', (event) => setMouseDown(event))
    map.addEventListener('mouseup', () => setMouseUp())

    map.addEventListener('touchmove', (event) => {
        event.preventDefault()
        moveAround(event)
    })
    map.addEventListener('touchstart', (event) => {
        event.preventDefault()
        setMouseDown(event)
    })
    map.addEventListener('touchend', () => {
        event.preventDefault()
        setMouseUp()
    })
}

function activateRegion(i, regions) {
    activeRegion = i
    clearRegions();
    text.innerHTML = regions.name
}

function highlightRegion() {

    x.style.fill = "blue";
    map.style.cursor = "pointer"
}

function clearRegions() {
    for (let i = 0; i < regions[floor].length; i++) {
        if (i != activeRegion) {
            let x = document.getElementById("region_" + String(i))
            x.style.fill = "grey";
        }
    }
}

function moveAround(event) {
    if (mouseDown) {
        map.style.cursor = "move";

        if (event.clientX != undefined) {
            mx2 = event.clientX;
            my2 = event.clientY;
        } else {
            mx2 = event.touches[0].clientX;
            my2 = event.touches[0].clientY;
        }

        dx = mx2 - mx1;
        dy = my2 - my1;


        if (x > borderMinX) {
            x -= dx * zx / mapWidth / 2;
        } else if (dx > 0) {
            x += dx * zx / mapWidth / 2;
        }

        if (x < borderMaxX) {
            x -= dx * zx / mapWidth / 2;
        } else if (dx < 0) {
            x += dx * zx / mapWidth / 2;
        }
        
        if (y > borderMinY) {
            y -= dy * zy / mapHeight / 2;
        } else if (dy > 0) {
            y += dy * zy / mapHeight / 2;
        }

        if (y < borderMaxY) {
            y -= dy * zy / mapHeight / 2;
        } else if (dy < 0) {
            y += dy * zy / mapHeight / 2;
        }
       

        mx1 = mx2;
        my1 = my2;


        text.innerHTML += mx1

        updateView()
    }
}

function reload() {
    map.innerHTML = '';

}

function setMouseDown(event) {
    mouseDown = true;
    if (event.clientX != undefined) {
        mx1 = event.clientX;
        my1 = event.clientY;
    } else {
        mx1 = event.touches[0].clientX;
        my1 = event.touches[0].clientY;
    }

    map.style.cursor = "default"
}

function setMouseUp() {
    mouseDown = false;
    mx1 = 0;
    my1 = 0;

    map.style.cursor = "default"
}

function zoom(event) {
    // add touch

    if (zx > 100 && zy > 100) {
        zx -= event.deltaX
        zy -= event.deltaX
    } else {
        zx += 1;
        zy += 1;
    }
    if (zx > 110 && zy > 110) {
        x += event.deltaX / 2
    }
    updateView()
}

function goUp() {
    floor += 1;
}

function goDown() {
    floor -= 1;
}

function loadStyles() {

    // two trybes: one when height to width ratio is
    text.style.fontSize = "64px"

    map.style.cursor = "default"
    map.style.background = "black"
    map.style.width = "100%"
    map.style.height = "100%"

    body.style.overflow = "hidden"
    body.style.height = "100%"
}

function setPosVal(x, y, zx, zy) {
    return x + " " + y + " " + zx + " " + zy;
}

function updateView() {
    map.setAttributeNS(null, "viewBox", setPosVal(x, y, zx, zy));
}

constructor();




